export function getInstitutionsClient(
  country: string,
  method = "buy"
): Institution[] {
  try {
    const countryInstitutions = INSTITUTIONS_DATA.institutions[country];
    if (countryInstitutions && countryInstitutions[method]) {
      return countryInstitutions[method] as Institution[];
    }
    return [];
  } catch {
    return [];
  }
}

export function getAllInstitutionsClient(): Record<
  string,
  Record<string, Institution[]>
> {
  return INSTITUTIONS_DATA.institutions as unknown as Record<
    string,
    Record<string, Institution[]>
  >;
}

export function getLastUpdated(): string {
  return INSTITUTIONS_DATA.lastUpdated;
}
